import React from 'react';
import { Container } from 'react-bootstrap';

const Home = () => {
    return (
        <Container className="mt-5">
            <h1>Welcome to Smart Shopping</h1>
            <p>Your one-stop shop for all things awesome!</p>
        </Container>
    );
};

export default Home;
